      | 52787 -> { ItemTypeData.id= 52787; name= "Mid-grade Mimesis Gamma"; published= true; description= "This neural boost is listed in the DED inventory as a modification by CONCORD weapons technologists of standard capsuleer implant templates with control routines that mimic methods of enhancing the firepower of reverse-engineered Triglavian weaponry, at the cost of a slower build up to maximum particle stream output.    However, persistent rumors among New Eden's capsuleer, transhuman and wirehead communities suggest that the research and development group that created these implants was lead by a Society of Conscious Thought team with special expertise in so-called  restricted artificial intelligences . The possibility that these implants are based on RAI technology raises startling questions about the nature of the  mimesis  involved in these augmentations.    Primary Effect: +3 bonus to Willpower    Secondary Effect: 2.25% bonus to maximum damage output of entropic distintegrators    Tertiary Effect: -33% penalty to damage multiplier increase per cycle of entropic disintegrators    Set Effect: 20% bonus to the strength of all Mimesis implant secondary effects"; marketGroupId= Some(620); groupId= 300; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 1.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 422; value= 2.000000 }; { DogmaAttributeValueData.attributeId = 2823; value= 2.250000 }; { DogmaAttributeValueData.attributeId = 2824; value= -0.330000 }; { DogmaAttributeValueData.attributeId = 2825; value= 1.200000 }; { DogmaAttributeValueData.attributeId = 331; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 179; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 277; value= 3.000000 }; { DogmaAttributeValueData.attributeId = 182; va