      | 52884 -> { ItemTypeData.id= 52884; name= "Maelstrom Snowline Bladeracer SKIN"; published= true; description= "In the icy climes of the Northern Mikramurka on Matar there are many traditional forms of transport that take advantage of the snow and ice fields to be found there. One of the most celebrated is still found as a traditional sport around the seismically active western interior of that region.    The  bladeracer  sled competitions are usually held on the relatively gentle slopes of the dormant shield volcanoes typically found in the area. The climate means that the upper reaches of the volcanoes are covered in snow and ice all year round but the lower areas remain rather fertile and are warmed by vents. The consequent profusion of heathers and mosses give the hills and slopes their characteristic purple coloration during the  warm  season."; marketGroupId= Some(1967); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 52981 -> { ItemTypeData.id= 52981; name= "Triglavian Gate Spawner"; published= false; description= ""; marketGroupId= None; groupId= 227; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(10026); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 53175 -> { ItemTypeData.id= 53175; name= "Eagle Zento Isideko Combine SKIN"; published= true; description= "Now owned by the Sukuuvestaa megacorp, the Zento Isideko Combine represents the final fate of an old industrial concern from the early corporate era of Caldari society. Founded in the wave of corporate developments and consolidations of earlier business forms in the decades that followed first contact with the Gallente, Zento Isideko Combine was typical in its aspiration to become an interplanetary conglomerate in an era of enormous cultural and technological upheaval for the Caldari people.    Led by their visionary founder Foss Kriistavaa, the Zento Isideko Combine rapidly became a leader in the construction of advanced transportation links across Caldari Prime and eventually realized the founding ambition of becoming an space-industrial powerhouse. Zento Isideko maintained its place in the upper tier of Caldari corporations for nearly 200 years, until the <i>Third Sontogi Oskkaltiovone</i>* of 22714 AD brought it within the sphere of a corporate grouping that would eventually become the Sukuuvestaa Corporation.    After various corporate permutations over the centuries, the business is generally known as SuVee ZenIko on the stock markets. Even so, the old Zento Isideko Combine brand and livery is still used to distinguish the support fleets of the transportation construction, maintenance and security operations that the division carries out across the extensive holdings of Sukuuvestaa.    (<i>Sontogi Oskkaltiovone</i> – loosely translated: rules-based corporate war of takeovers)"; marketGroupId= Some(2070); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 53272 -> { ItemTypeData.id= 53272; name= "Republic Fleet Elite Frigate Wreck"; published= false; description= ""; marketGroupId= None; groupId= 186; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 161; value= 27500.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 14.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 10000.000000 }; { DogmaAttributeValueData.attributeId = 901; value= -10.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 27500.000000 }; { DogmaAttributeValueData.attributeId = 552; value= 5000.000000 }; { DogmaAttributeValueData.attributeId = 9; value= 700.000000 }; { DogmaAttributeValueData.attributeId = 525; value= 1.000000 } |]; dogmaEffects= [|  |]; capacity= 27500.000000; graphicId= Some(3117); mass= 10000.000000; packagedVolume= 27500.000000; portionSize= 1; radius= 14.000000; volume= 27500.000000 } |> Some
      | 53369 -> { ItemTypeData.id= 53369; name= "Executioner Aurora Universalis SKIN"; published= true; description= "Auroras, or polar lights, are a universal concept and shared experience among the peoples of New Eden. The heavily-populated terrestrial home planets are particularly noted for stories and myths involving these striking, dancing lights in the sky.    To the Amarr, the aurora are linked to ancient religious stories and are sometimes known as  Sefrim Banners , alluding to the angelic figures considered messengers from God. A tradition of the appearance of these lights heralding divine approval for the armies of Amarr during the Reclaiming of Athra is well attested.    For the Caldari, the polar lights are the enigmatic  Flame Wind , a mysterious force in the animistic mythology of Caldari Prime's pre-industrial era. On the cold Caldari home world, the appearance of the aurora was associated with unusual weather and sudden migrations of animals.    The various nations of Gallente Prime had their ancient legends about polar lights but knew the aurora to be an interaction of atmosphere, magnetic fields and stellar winds from the time of the  Airship Wars . Viewing aurora on airship trips to the polar regions of Gallente Prime is a popular tourist activity on the planet.    The Minmatar have a somewhat mixed viewpoint on aurora, with some believing that such lights were seen during the storms that wracked Matar during the  Day of Darkness  that heralded the Amarr invasion. However, most think this notion misreads the fragmentary tales of what happened in those times. The traditional view of the polar lights, at least for tribes such as the Brutor and Sebiestor, is that they represent a  standing place gathering  or moot of tribal spirits.    At the time of the Yoiul Festival, the aurora lights of the worlds of New Eden are one reminder of the shared history of the people of the cluster and have becomes a symbol to some of their universal connections with one another."; marketGroupId= Some(2002); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
